import './tile.css'
import Piece, { PieceObject } from '../Piece/Piece';

export enum TileColor { DARK, LIGHT }

export default function Tile(props: {color: TileColor, piece ?: PieceObject}) {
  return (
    <div className={props.color === TileColor.DARK ? 'tile dark' : 'tile light'}>
      {props.piece === undefined ? null : <Piece piece={piece}/>}
    </div>
  );
}
